import { BrowserRouter, BrowserRouter as Router, Route, Switch, Link, Routes} from 'react-router-dom';
import React from 'react';
import './App.css';
import Home from './Pages/Home';
import Login from "./Pages/Login";



function App() {
  return (

    <BrowserRouter>
      <Routes>
      <div className="App">

         <Route exact path="/" element={<Home />}  />
         <Route  path="/login">
         <Login/>
         </Route>
      </div>
      </Routes>
    </BrowserRouter>


  );
}

export default App;
